import React from "react";
import { Typography ,TextField,Grid } from "@mui/material";
import "./App.css";
import logo from "./images/light-logo.png";

function App() {
  const popupStyle = {
    backgroundColor: "rgb(100, 64, 189)",
    width: "25%",
    height: "90vh",
  };

  return (
    <div className="App" style={popupStyle}>
      <img style={{ width: "200px", margin: "20px" }} src={logo} alt="logo" />
      <Typography>
        Sign in to your account
      </Typography>
      <Grid>
      <TextField id="outlined-basic" label="Enter " variant="outlined" />
      </Grid>
    </div>
  );
}

export default App;
